import React from "react";
import {useParams} from "react-router-dom"

function Study({card, deck}){
  const userId = useParams();
  console.log(userId)
  return(
    <>
      <h3>Study: {deck.title}</h3>
      <div className="card">
        <div className="card-title">
          {card.front}
        </div>
      </div>
    </>
  )
}



export default Study;
